import styled from 'styled-components';

export const HomeContainer = styled.div`
	min-width:1000px;
	width: 90%;
	margin: 30px auto;
	background:#ccc;
	overflow:hidden;
`;

export const LeftContainer = styled.div`
	float:left;
	width:65%;
	height:400px;
`;

export const RightContainer = styled.div`
	float: right;
	width:32%;
	height:400px;
	background:green;
`;

//Banner
export const BannerWrapper = styled.div`
	width:625px;
	height:270px;
	padding-left:-625px;
	overflow:hidden;
	margin:0 auto;
	.bannerImg{
		width:100%;
		height:100%;
	}
`;
